import React from 'react';
import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet';
import { useCallback, useEffect, useState } from 'react';
import 'leaflet/dist/leaflet.css';
import './App.css'
import DatePicker from "react-datepicker"
import "react-datepicker/dist/react-datepicker.css"

// Correction du bug d’icône de Leaflet
import L from 'leaflet';
import markerIcon2x from 'leaflet/dist/images/marker-icon-2x.png';
import markerIcon from 'leaflet/dist/images/marker-icon.png';
import markerShadow from 'leaflet/dist/images/marker-shadow.png';

delete L.Icon.Default.prototype._getIconUrl;
L.Icon.Default.mergeOptions({
  iconRetinaUrl: markerIcon2x,
  iconUrl: markerIcon,
  shadowUrl: markerShadow,
});

let match = class {

};

function searchMatchBetweenDates(startDate, endDate){
  result = null;
  fetch('http://localhost:3001/api/matchs?startDate=' + startDate + '&endDate=' + endDate)
    .then((res) => res.json())
    .then(result = res);
  return result;
}

function App() {
  const [startdate, setStartDate] = useState(new Date());
  const [enddate, setEndDate] = useState(new Date());
  const now = new Date();
  const [message, setMessage] = useState('');
  const dateLabel = { 'aria-label': 'Date' };

  useEffect(() => {
    fetch('http://localhost:3001/api/hello')
      .then(res => res.json())
      .then(data => setMessage(data.message));
  }, []);

  return (
    <div className="container" >
      <div className="map" >
        <MapContainer
          center={[48.8566, 2.3522]}
          zoom={12.5}
          scrollWheelZoom={false}
          style={{width: "100%", height: "100%"}}
        >
          <TileLayer
            attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
            url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
          />
          <Marker position={[48.8413889, 2.2530555555555556]}>
            <Popup>
              Stade du Parc des Princes<br />Football - Domicile du PSG Football <br /> PSG - Reims
            </Popup>
          </Marker>
          <Marker position={[48.8433333, 2.2530555555555556]}>
            <Popup>
              Stade Jean-Bouin <br />Football - Domicile du Paris Football Club<br /> Paris FC - Olympique de Marseille
            </Popup>
          </Marker>
          <Marker position={[48.8186111, 2.346388888888889]}>
            <Popup>
              Stade Sébastien Charléty <br />Baseball - Domicile du Paris Université Club<br />Football - Domicile du Paris Football Club Féminin<br /> Paris FC - Olympique de Marseille
            </Popup>
          </Marker>
          <Marker position={[48.8994444, 2.361388888888889]}>
            <Popup>
              <h2>Arena Porte de la Chapelle</h2> <br /><h3>Basketball - Domicile du Paris Basketball</h3><br /> Paris Basket - Le Mans
            </Popup>
          </Marker>
        </MapContainer>
      </div>
      <div className="list">
        <h2>Période</h2>
        Entre <DatePicker selected={startdate} onChange={(date) => setStartDate(date)} />
        <br/>
        Et <DatePicker selected={startdate} onChange={(date) => setStartDate(date)} />
          <br/>
        <button type="onClick">Submit</button>
        <h1>Message du backend :</h1>
        <p>{message}</p>
      </div>
    </div>
  );
}

export default App;
